import React from 'react'

const CalButton = ({ diplayState, setDisplayState }) => {

    const onClickButton = () => {
        console.log(props.character)
    }

    return (
        <button
            className="CalButton"
            onClick={onClickButton}
        >
            {props.character}
        </button>
    )
}

export { CalButton }
